import React from 'react'

function ListUsers({users = []}) {

  return (
    <>
        <h1>Usuarios</h1>
        <ul>
            {users.forEach(u => {
                <li>{u.usuario}</li>
            })}
        </ul>
    </>
  )
}

export default ListUsers
